import React from "react";
import axios from "axios";
import barcode from "https://cdn.jsdelivr.net/npm/jsbarcode@3.11.3/dist/JsBarcode.all.min.js";


class Ass extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      books: []
    };
  }

  componentDidMount() {
    let url = "/aaliterature";
    axios.get(url).then(response => this.setState({
      books: response.data
    }))
    include
  }

  render() {
    return (
      <div className="literatureContainer">
        <div className="literatureInner">

          {this.state.books.map(p => (
            <div key={p.id} className="labelOuter">
              <div className="labelInner">

                <div className="price">${p.price}</div>

                <div className="mainDesc">{p.mainDesc}</div>
                <div className="secondaryDesc">{p.secondaryDesc}</div>

                <div className="codes">
                  <div className="upc">{p.upc}</div>
                  <div className="sku">{p.sku}</div>
                </div>

              </div>
            </div>
          ))}

        </div>
      </div>
    );
  }
}

export default Ass;
